CREATE TABLE `Student` (
  `sID` char(16) NOT NULL COMMENT '学生号\n            每个学生的唯一标识，也作登陆账号',
  `sName` char(32) NOT NULL COMMENT '学生名',
  `sPhone` char(16) DEFAULT NULL COMMENT '学生电话',
  `password` varchar(32) NOT NULL COMMENT '学生登陆密码',
  `dID` int(11) DEFAULT NULL COMMENT '学位序号',
  `majID` char(16) DEFAULT NULL COMMENT '专业号',
  `grade` int(11) DEFAULT NULL COMMENT '年级\n            参照本校制度以入学年份划分，换句话说此项存的就是入学年份2019这些数，故为整形',
  `class` int(11) DEFAULT NULL COMMENT '班级号',
  `bID` char(4) DEFAULT NULL COMMENT '宿舍楼号',
  `rID` char(4) DEFAULT NULL COMMENT '房间号',
  `sex` int(2) NOT NULL,
  PRIMARY KEY (`sID`),
  KEY `FK_Belong` (`dID`,`majID`,`grade`,`class`),
  KEY `FK_LiveIn` (`bID`,`rID`),
  CONSTRAINT `FK_Belong` FOREIGN KEY (`dID`, `majID`, `grade`, `class`) REFERENCES `Class` (`dID`, `majID`, `grade`, `class`),
  CONSTRAINT `FK_LiveIn` FOREIGN KEY (`bID`, `rID`) REFERENCES `Room` (`bID`, `rID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='学生表';
